import React from "react";
import Slider from "react-slick";

const Testimonials = () => {
  return (
    <Slider>
      <div className="testimonial py-4 px-3">
        <p>
          Lorem ipsum, dolor sit amet consectetur adipisicing elit. Maiores,
          itaque delectus, saepe eligendi officiis nam atque provident
          praesentium officia, consequuntur rem! Iure nobis vel consequatur
          recusandae consequuntur modi totam error, impedit itaque ab aliquam,
          fuga expedita.
        </p>
      </div>
    </Slider>
  );
};

export default Testimonials;
